pragma solidity ^0.8.16;

import "@rsksmart/erc677/contracts/IERC677.sol";
import "@rsksmart/erc677/contracts/IERC677TransferReceiver.sol";
import "../NodeOwner.sol";
import "../PartnerManager/IPartnerManager.sol";
